import blogs from "blog.json";
export default function Blog() {
  return (
    <div className="bg-[#8e41b0] h-screen">
        <h1 className='text-3xl text-white font-semibold pt-10 text-center '>Will be updated soon..</h1>
        {blogs.map()}
    </div>
  )
}
